import React from 'react';
import FadeIn from 'react-fade-in';
import Resume2 from '../Images/Daniel Bradley Resume (1).pdf';
import Download from '../Images/download.png';
// import Downloader from './components/Downloader';
import { Container } from 'react-bootstrap';

const Resume = () => {
  return (

    <FadeIn transitionDuration={1000}>
    <Container fluid="lg bg-dark bg-opacity-75 mb-5 resume-container" id="resume">
      <h1 class="display-4 text-light text-center pt-2 fw-normal">Experience</h1>
      <div>
      <i class="devicon-html5-plain-wordmark colored"></i>
      <i class="devicon-css3-plain colored"></i>
      <i class="devicon-materialui-plain colored"></i>
      <i class="devicon-bulma-plain colored"></i>
      <i class="devicon-bootstrap-plain colored"></i>
      <i class="devicon-javascript-plain colored"></i>
      <i class="devicon-jquery-plain-wordmark colored"></i>
      <i class="devicon-react-original-wordmark colored"></i>
      <i class="devicon-handlebars-plain-wordmark colored text-warning"></i>

      <i class="devicon-github-original text-white" ></i>
      <i class="devicon-git-plain-wordmark colored"></i>
      <i class="devicon-heroku-original-wordmark colored"></i>
      <i class="devicon-nodejs-plain-wordmark colored"></i>
      <i class="devicon-express-original-wordmark text-white"></i>
      <i class="devicon-mongodb-plain-wordmark colored"></i>
      <i class="devicon-graphql-plain-wordmark colored"></i>
      <i class="devicon-mysql-plain-wordmark text-primary"></i>
      <i class="devicon-sequelize-plain text-white"></i>
      <i class="devicon-vscode-plain-wordmark colored"></i>






















      </div>
      <div className="resume-download-div ">
      <h2>Download My Resume</h2>
      <a href={Resume2} target="_blank" >
        <img src={Download} alt="download-arrow"></img>
      </a>
      </div>
    </Container >
    </FadeIn>
  );
};

export default Resume;
